targets.expr:
label_replace(
    label_replace(
        (
            topk(
                1,
                first_over_time(
                    (
                        timestamp(
                            count by(ic_active_version, ic_subnet) (ic_replica_info{ic="$ic"})
                        )
                    )[$__range_s:$__interval]
                )
                and
                    (
                        sum by (ic_active_version, ic_subnet) (ic_replica_info{ic="$ic"})
                    )
                ) by (ic_subnet)
            ),
        "ic_subnet", "$1", "ic_subnet", "([a-z0-9]+)-.*"
    ),
    "ic_active_version", "$1", "ic_active_version", "([a-z0-9]{7}).*"
)
